    "title": "MAPID Berhasil Menjadi Salah Satu Startup Terpilih dalam MRT Accel 2020",
    "date": "2020-08-10T00:00:00.000Z",
    "bracket": "blog",
    "sub_bracket": "achievement",
    "editorState": "{\"blocks\":[{\"key\":\"8jusd\",\"text\":\"Pada bulan Agustus 2020 MAPID berhasil menjadi salah satu partner startup dalam program MRT Accel 2020. Terpilih menjadi partner startup untuk program Akselerasi MRT merupakan pencapaian yang baru bagi MAPID dan merupakan kesempatan emas bagi MAPID untuk berkembang. MAPID akan membantu MRT dalam memetakan potensi pasar untuk UMKM dan juga usaha-usaha lain (Merchants) yang berada di sekitar MRT.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":58,\"length\":16,\"style\":\"ITALIC\"},{\"offset\":121,\"length\":16,\"style\":\"ITALIC\"},{\"offset\":191,\"length\":1,\"style\":\"ITALIC\"},{\"offset\":358,\"length\":12,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"bvcnr\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"b2ecp\",\"text\":\" \",\"type\":\"atomic\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[{\"offset\":0,\"length\":1,\"key\":0}],\"data\":{}},{\"key\":\"1f2pe\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3b8u9\",\"text\":\"Dari 40 jumlah perusahaan startups yang mengikuti seleksi, hanya 10 perusahaan startups yang berhasil lolos. Daftar 10 peserta perusahaan startups yang berhasil lolos diantaranya adalah Pasar Polis (teknologi asuransi), Jakarta Bike Hub (kanal sepeda berbagi), Bobobox (sektor penginapan dalam bentuk hotel kapsul), MAPID (pengembang Sistem Informasi Geografis), Pintaria by Haruka Edu (penyedia kursus daring dan kelas karyawan), Maingame (kanal gim daring), Jejak.in (penyedia perangkat lunak penghitung dampak terhadap lingkungan dari aktivitas manusia), Sonicboom (pengumpul data mobilitas manusia), Nodeflux (bidang Computer Vision dan kecerdasan buatan (Artificial Intelligence), dan Rekosistem (pengelolaan limbah).\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":26,\"length\":9,\"style\":\"ITALIC\"},{\"offset\":79,\"length\":9,\"style\":\"ITALIC\"},{\"offset\":138,\"length\":9,\"style\":\"ITALIC\"},{\"offset\":621,\"length\":15,\"style\":\"ITALIC\"},{\"offset\":660,\"length\":23,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"bksnb\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5t968\",\"text\":\"MRT Accel adalah program akselerasi dengan melakukan kolaborasi antara MRT Jakarta dan perusahaan startups di Indonesia, khususnya di bidang digital, untuk memberdayakan ekonomi digital dengan membuat produk bisnis atau jasa komersil yang akan memberikan dampak sosial melalui platform MRT. Tujuan dari program ini adalah sebagai inovasi untuk memaksimalkan fungsi yang telah dijalankan MRT Jakarta. MAPID dan juga perusahaan startups lainnya akan menjalin kerja sama dengan MRT Jakarta selama 6 bulan.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":98,\"length\":9,\"style\":\"ITALIC\"},{\"offset\":119,\"length\":2,\"style\":\"ITALIC\"},{\"offset\":277,\"length\":8,\"style\":\"ITALIC\"},{\"offset\":426,\"length\":9,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"2isgt\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"200r3\",\"text\":\"Program akselerasi sendiri merupakan program yang berbeda dengan program inkubasi. Program inkubasi relatif lebih lama dibandingkan program akselerasi. Karena program inkubasi biasanya diperuntukkan untuk perusahaan startup yang berada pada tahap awal atau early stage dengan tujuan pembuktian konsep (proof of concept) sedangkan program akselerasi biasanya diperuntukkan untuk perusahaan startup yang telah memiliki produk dengan tujuan pengembangan bisnis. Proses seleksi untuk tergabung dalam program akselerasi startup cenderung lebih ketat jika dibandingkan dengan program inkubasi.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":216,\"length\":8,\"style\":\"ITALIC\"},{\"offset\":257,\"length\":11,\"style\":\"ITALIC\"},{\"offset\":301,\"length\":18,\"style\":\"ITALIC\"},{\"offset\":389,\"length\":8,\"style\":\"ITALIC\"},{\"offset\":515,\"length\":8,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"54so3\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"d8lo5\",\"text\":\"Pada program kerja sama akselerasi antara MRT Jakarta dan MAPID ini akan difokuskan untuk membantu usaha-usaha (Merchants) yang ada di sekitar stasiun MRT. Bisnis ini akan didasarkan pada TOD (Transit Oriented Development) atau yang dikenal dengan istilah Kawasan Berorientasi Transit. MAPID dan juga MRT Jakarta akan bekerja sama dengan beberapa merchants yang ada di sekitar stasiun MRT Jakarta untuk pengembangan bisnis berbasis lokasi. Data yang didapatkan akan divisualisasikan dalam bentuk peta yang kemudian dapat digunakan oleh merchants untuk mengidentifikasi potensi pasar sehingga merchants dapat menentukan strategi bisnisnya dengan tepat dan meningkatkan usahanya. Selain itu, penumpang MRT juga dapat dengan mudah menemukan toko, kafe, restoran, dan tempat lainnya yang mereka butuhkan di sekitar stasiun MRT. Dari kerja sama tersebut diharapkan MAPID dapat membantu MRT dan merchants di sekitar stasiun dalam pengembangan bisnisnya.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":111,\"length\":11,\"style\":\"ITALIC\"},{\"offset\":192,\"length\":30,\"style\":\"ITALIC\"},{\"offset\":347,\"length\":10,\"style\":\"ITALIC\"},{\"offset\":536,\"length\":10,\"style\":\"ITALIC\"},{\"offset\":592,\"length\":10,\"style\":\"ITALIC\"},{\"offset\":889,\"length\":10,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"52eut\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7nphc\",\"text\":\" \",\"type\":\"atomic\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[{\"offset\":0,\"length\":1,\"key\":1}],\"data\":{}},{\"key\":\"2fl0v\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{\"0\":{\"type\":\"image\",\"mutability\":\"IMMUTABLE\",\"data\":{\"src\":\"https://s3.us-west-2.amazonaws.com/machrus/doc_pictures/1597039744.png\"}},\"1\":{\"type\":\"image\",\"mutability\":\"IMMUTABLE\",\"data\":{\"src\":\"https://s3.us-west-2.amazonaws.com/machrus/doc_pictures/1597039770.png\"}}}}",
    "link": "mapid_berhasil_menjadi_salah_satu_startup_terpilih_dalam_mrt_accel_2020"
