    "title": "Seminar UNJANI",
    "date": "2020-04-07T00:00:00.000Z",
    "bracket": "blog",
    "sub_bracket": "seminar",
    "editorState": "{\"blocks\":[{\"key\":\"4musg\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"ahd4r\",\"text\":\" \",\"type\":\"atomic\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[{\"offset\":0,\"length\":1,\"key\":0}],\"data\":{}},{\"key\":\"2jcr\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3k8um\",\"text\":\"Hi! Happy Monday! How's your weekend? We know, it's exciting since we are about to roll up 2019. But, since it has not ended yet, we have our one last closing event. The latest seminar was held at Jenderal Achmad Yani University, Cimahi, Bandung on December 21st 2019. We want to tell you that it was fun! We exchanged thoughts about Internet of Things and virtual network. We are glad that there so many young-spirited person in the room who asked brilliant questions regarding to the technology! This is when we know that we are walking on the right track to unfold the challenging and technology-oriented years ahead.  Don't miss our next MAPID Goes To Campus! Oh, perhaps it's your campus that we're going to visit next? Happy holiday and see ya!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{\"0\":{\"type\":\"image\",\"mutability\":\"IMMUTABLE\",\"data\":{\"src\":\"https://s3.us-west-2.amazonaws.com/machrus/doc_pictures/1587354543.jpeg\"}}}}",
