    "bracket": "blog",
    "sub_bracket": "seminar",
    "editorState": "{\"blocks\":[{\"key\":\"2qesq\",\"text\":\"Seminar ALGOMARINE\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2euq9\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7v93i\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"59kbl\",\"text\":\" \",\"type\":\"atomic\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[{\"offset\":0,\"length\":1,\"key\":0}],\"data\":{}},{\"key\":\"581gv\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7g394\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"e2n0o\",\"text\":\"2020 runs super fast and itâ€™s March already! Good morning, friends. We would like to show you the highlights of our latest event. Talking about the implementation of IOT in Oceanography has broadened our horizon. Now, we know the importance of ocean buoys. No, itâ€™s not just there and floating. Ocean buoys are equipped with an array of sensors that measure all the parameters of air and water. Yes, this is the IOT in Oceanography weâ€™re talking about. Itâ€™s also interesting to know that there are deep-sea sensors to detect earthquake and other related natural disaster.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1ohsg\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bd5f2\",\"text\":\"Thank you, Algomarine, for having us. Itâ€™s a fun sharing session. See you in another event!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{\"0\":{\"type\":\"image\",\"mutability\":\"IMMUTABLE\",\"data\":{\"src\":\"https://s3.us-west-2.amazonaws.com/machrus/doc_pictures/1587350401.jpg\"}}}}",
